import React from "react";
import { Container } from "react-bootstrap";

let movieList = () => {
    return (
        <>
            <Container>
                <div className="list">
                    <div className="">
                        <div className="img">
                            <img src="./src/images/moviesImg.jpg"></img>
                        </div>
                    </div>
                </div>
            </Container>
        </>
    )
}

export default movieList
